        if (e.which === 13) {
            e.preventDefault();
            $('#PhoneNumber').focus();
        }
    });

    $('#PhoneNumber').on('keypress', function (e) {

        $(""#Mobile-wrong"").addClass(""hidden"");

        if (e.which === 13) {
            e.preventDefault();
            $('#CustomerTypeName').data(""kendoAutoComplete"").focus();
        }
    });


    $('#PhoneNumber').on('input', function (e) {
        this.value = this.value.replace(/[^0-9]/g, '');

    });


    $(""#CustomerTypeName"").on('focus', function (e) {

      ");
